INSERT INTO `wp_posts` VALUES (93,1,'2022-05-08 15:07:29','2022-05-08 15:07:29','<label> Tu nombre\n    [text* your-name] </label>\n\n<label> Tu correo electrónico\n    [email* your-email] </label>\n\n<label> Asunto\n    [text* your-subject] </label>\n\n<label> Tu mensaje (opcional)\n    [textarea your-message] </label>\n\n[submit \"Enviar\"]\n[_site_title] «[your-subject]»\n[_site_title] <dev-email@flywheel.local>\nDe: [your-name] <[your-email]>\nAsunto: [your-subject]\n\nCuerpo del mensaje:\n[your-message]\n\n-- \nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] «[your-subject]»\n[_site_title] <dev-email@flywheel.local>\nCuerpo del mensaje:\n[your-message]\n\n-- \nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nGracias por tu mensaje. Ha sido enviado.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nUno o más campos tienen un error. Por favor, revísalos e inténtalo de nuevo.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nDebes aceptar los términos y condiciones antes de enviar tu mensaje.\nEl campo es obligatorio.\nEl campo es demasiado largo.\nEl campo es demasiado corto.\nHa ocurrido un error desconocido al subir el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo es demasiado grande.\nHa ocurrido un error al subir el archivo.','Formulario de contacto 1','','publish','closed','closed','','formulario-de-contacto-1','','','2022-05-08 15:07:29','2022-05-08 15:07:29','',0,'http://localhost:10010/?post_type=wpcf7_contact_form&p=93',0,'wpcf7_contact_form','',0);
